import React, { Fragment } from 'react';
import{Inputcss,Labelcss} from './btncss.js';
const btnicon = () => {
	return (
		<Fragment>
			<input type="checkbox"  id="nav" />
			<label htmlFor="nav" />
		</Fragment>
	);
};
export default btnicon;
